namespace SpriteKind {
    export const Big_Bad_BOSS = SpriteKind.create()
    export const Star = SpriteKind.create()
}
controller.A.onEvent(ControllerButtonEvent.Pressed, function () {
    if (showing_start == 0) {
        for (let index = 0; index < 10; index++) {
            mySprite.y += -2
            pause(50)
        }
        for (let index = 0; index < 5; index++) {
            mySprite.y += -1
            pause(50)
        }
        if (controller.A.isPressed()) {
            for (let index = 0; index < 5; index++) {
                mySprite.y += -1
                pause(50)
            }
            for (let index = 0; index < 5; index++) {
                mySprite.y += 1
                pause(50)
            }
        }
        for (let index = 0; index < 5; index++) {
            mySprite.y += 1
            pause(50)
        }
        for (let index = 0; index < 10; index++) {
            mySprite.y += 2
            pause(50)
        }
    }
})
info.onLifeZero(function () {
    lives += -1
    info.setLife(3)
    tiles.placeOnTile(mySprite, tiles.getTileLocation(1, 4))
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.Big_Bad_BOSS, function (sprite, otherSprite) {
    if (sprite.y + 5 < otherSprite.y - 14) {
        Mega_Bad_Yuck_life += -1
        otherSprite.say(convertToText(bad_yuck_life), 2000)
        pause(2000)
    } else {
        info.changeLifeBy(-1)
        sprite.say("Ouch", 2000)
        pause(2000)
    }
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.Star, function (sprite, otherSprite) {
    music.playMelody("C D E F G A B C5 ", 500)
    pause(300)
    game.over(true, effects.confetti)
})
controller.combos.attachSpecialCode(function () {
    if (showing_start == 1) {
        button_combo = 1
    }
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.Enemy, function (sprite, otherSprite) {
    if (sprite.y + 5 < otherSprite.y - 5) {
        bad_yuck_life += -1
        otherSprite.say(convertToText(bad_yuck_life), 2000)
        pause(2000)
    } else {
        info.changeLifeBy(-1)
        sprite.say("Ouch", 2000)
        pause(2000)
    }
})
